import queryString from "query-string";
import io from "socket.io-client";

import "./Chat.css";

const Chat = ({ location }) => {
  useEffect(() => {
    const { name, room } = queryString.parse(location.search);

    console.log(name);
    console.log(room);
    console.log(location.search);
  });
  return <h1>Chat</h1>;
};

export default Chat;
